import './App.css'
import './component_css/Attention.css'
import './component_css/Header.css'
import './component_css/Form.css'
import Attention from './component/Attention';
import Header from './component/Header';
import Homepage from './Router/Homepage'
import Form from './Router/Form';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import { useState } from 'react';






function App() {

    const [measureData, setMeasureData] = useState({
      height: '',
      width: '',
    });
    return (
      <Routes>
        <Route
          path="/"
          element={<Homepage />}
        />
        {/* Attention bileşenine sadece measureData'yı geçiriyoruz */}
        <Route
          path="/attention"
          element={<Attention measureData={measureData} />}
        />
        {/* Form bileşenine hem measureData'yı hem de setMeasureData fonksiyonunu geçiriyoruz */}
        <Route
          path="/form"
          element={<Form measureData={measureData} setMeasureData={setMeasureData} />}
        />
      </Routes>
    );
  }

  export default App;
